   AND @@TRANCOUNT > 0
    BEGIN
        ROLLBACK;
    END

IF @@TRANCOUNT = 0
    BEGIN
        INSERT  INTO #tmpErrors (Error)
        VALUES                 (1);
        BEGIN TRANSACTION;
    END


GO
PRINT N'Adding files to assembly [SpatialCutouts]';


GO
ALTER ASSEMBLY [SpatialCutouts]
    DROP FILE ALL
    ADD FILE FROM  AS N'GetBoxCutout.cs',  AS N'GetBoxCutoutConsole.cs',  AS N'Properties\AssemblyInfo.cs',  AS N'SPGetBoxCutout.cs',  AS N'Tuple.cs',  AS N'bin\Debug\SpatialCutouts.pdb';


