        BEGIN TRANSACTION;
    END


GO
PRINT N'Creating [SpatialCutouts].[SqlAssemblyProjectRoot]...';


GO
EXECUTE sp_addextendedproperty @name = N'SqlAssemblyProjectRoot', @value = N'C:\Users\group1\Documents\Visual Studio 2010\Projects\SpatialCutouts\SpatialCutouts', @level0type = N'Assembly', @level0name = N'SpatialCutouts';


GO
IF @@ERROR <> 0
   AND @@TRANCOUNT > 0
