GO
EXECUTE sp_addextendedproperty @name = N'SqlAssemblyFile', @value = N'SPGetBoxCutout.cs', @level0type = N'SCHEMA', @level0name = N'dbo', @level1type = N'PROCEDURE', @level1name = N'SPGetBoxCutout';


GO
